import React from 'react';

import classes from './Card.module.css';

const card = ( props ) => {
    return (
            <div className={classes.Card}>
                <span className={classes.Feira}>
                    Nome: {props.nome}
                </span>
                <span className={classes.Feira}>
                    Descrição: {props.descr}
                </span>
                <span className={classes.Feira}>
                    Descrição: {props.descr}
                </span>
                <span className={classes.Feira}>
                    Descrição: {props.descr}
                </span>
            </div>
    );
};

export default card;
